import styles from "./SectionC.module.css";
import pp1 from "./PP/pp1.jpg";
function SectionC() {
  return (
    <main className={styles.main}>
      <h1 className={styles.head}>Join a growing community of readers</h1>
      <article className={`${styles.article} ${styles.article_1}`}>
        <div className={styles.article_header}>
          <img src={pp1} alt="profile picture"></img>
        </div>
      </article>
      <article className={`${styles.article} ${styles.article_2}`}></article>
      <article className={`${styles.article} ${styles.article_3}`}></article>
      <article className={`${styles.article} ${styles.article_4}`}></article>
    </main>
  );
}
export default SectionC;
